            {props.packagesList.map((item,index) => {
                return (<div>
                    <h2>{item}</h2>
                    <input key={index} className="tiny ui button" type="button" value="Delete" /*onClick={() => { props.selectedForDeleting(item) }}*/ />
                </div>
                )
            })}
        </div></>
    );
}
const myMapStateToProps = (state) => {
    return {
        packagesList: state.auction.packagesList
    }
}
export default connect(myMapStateToProps)(PackagesListList);
